import React from 'react'

class FeedItem extends React.Component{
    render(){
        const style={
            display: 'flex',
            justifyContent: 'center',
            flexDirection: 'column',
            width: '100%',
            border: '1px #22303f solid',
            marginBottom: '30px',
            borderRadius: '5px',
            backgroundColor: '#141f2d',
            padding: '5px'
        }
        const horizontal={
            display: 'flex',
            flexDirection: 'row',
            alignItems:'center',
            margin: '20px'
          
        }

        const horizontal1={
            display: 'flex',
            flexDirection: 'row',
            alignItems:'center',
            justifyContent: 'end',
            position: 'absolute',
            right: '20px',
        }
        return(
            <div style={style}>
            <div style={horizontal}>
            <img style={{
                borderRadius: '50%'
            }} src='https://res.cloudinary.com/practicaldev/image/fetch/s--y4wodgwV--/c_fill,f_auto,fl_progressive,h_320,q_auto,w_320/https://thepracticaldev.s3.amazonaws.com/uploads/user/profile_image/177966/0f8eb580-5b46-4ba7-8390-18d85b04c7be.jpg' alt="text" width='60' height='60'/>
            <div className='hero'>
            <h1>Who is the world's greatest hero?</h1> 
            <h3>Jane Doe ãƒ» <span>Aug 15</span> <span style={{fontWeight: 'normal'}}>(5 mins ago)</span></h3>
            <p><span><a href=''>#lua</a></span> <span><a href=''>#scala</a></span> <span><a href=''>#webdev</a></span></p>

            <style jsx>
            {`
            .hero *{
                margin: 2px
            }
            .hero{
                margin: 0px 20px
            }
            `}
            </style>
            </div>
            </div>

            <div style={{display: 'flex', flexDirection: 'row', alignItems:'center', position: 'relative', marginTop: '20px', marginLeft: '20px'}}>
             <img src='https://practicaldev-herokuapp-com.freetls.fastly.net/assets/reactions-stack-ee166e138ca182a567f74c986b6f810f670f4d199aca9c550cc7e6f49f34bd33.png' width='40' height='30' alt='hearts'/> <p style={{marginLeft: '10px'}}>99</p>
             <div style={horizontal1}>
             <p>8 mins read</p>
             <button style={{
                 background: '#0d36ff',
                 color: 'white',
                 border: 'none',
                 padding: '5px',
                 borderRadius: '3px',
                 marginLeft: '10px'
             }}>SAVE</button>
             </div>
            </div>
        </div>
        )
    }
}

export default FeedItem
